import React from "react";
import styles from "./WhatsAppButton.module.scss";
import OtherStyles from "./CatalogButton.module.scss";
import { library } from "@fortawesome/fontawesome-svg-core";
import { fab } from "@fortawesome/free-brands-svg-icons";
import { faWhatsapp } from "@fortawesome/free-brands-svg-icons";

library.add(fab, faWhatsapp);
export const WhatsAppButton = () => {
  const handleClick = () => {
    window.open(
      "https://api.whatsapp.com/send?phone=SEU_NUMERO_DE_TELEFONE",
      "_blank"
    );
  };

  return (
    <div className="rs-video whatsapp-fixed">
      <div className="animate-border">
        <a
          className="video-vemo-icon btn-whatsapp"
          aria-label="WhatsApp"
          href="https://api.whatsapp.com/send?phone=11996610300"
          target="_blank"
          rel="noopener noreferrer"
        >
          <i className="fab fa-whatsapp"></i>
        </a>
      </div>
    </div>
  );
};

